import HorizonLine from "../horizontal";

export default function ServerTime() {
  return (
    <div style={{ display: "inline-block", width: "256px", marginTop: "10px" }}>
      <span style={{ 
        display: "block", 
        width: "100%", 
        height: "48.5px", 
        border: "1px solid #70BB53",
        backgroundColor: "#ffffff", 
        borderRadius: "8px 8px 0 0", // 상단 부분만 둥글게 처리
        textAlign: "center", // 텍스트 가운데 정렬
        lineHeight: "48.5px", // 텍스트 수직 가운데 정렬
      }}>
        서버시간
      </span>
      
      <span style={{ 
        display: "block", 
        width: "100%", 
        height: "48.5px", 
        border: "1px solid #70BB53",
        backgroundColor: "#ffffff", 
        borderRadius: "0 0 8px 8px", // 하단 부분만 둥글게 처리
        textAlign: "center", // 텍스트 가운데 정렬
        lineHeight: "48.5px", // 텍스트 수직 가운데 정렬
      }}>
        추가 내용
      </span>
    </div>
  );
}
